import React from 'react';

const Options = ({value, count}) => {
    return(
      <div>
        <p>{value} 
          <span className="badge badge-warning m-2">{
            count}
          </span> 
          <button className='btn btn-danger btn-sm'>+</button>
        </p>
      </div>
    );
}

export default Options;
